    Activity on Line 30b.  Please note that the employees that were disclosed on Schedule
    H4 supporting Line 21(a) as payroll spent less than 25% of their time during the
    period working on any Federal Election Activity or activities in connection with
    a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees.  -   The Memo Schedule A's that
    itemize the committees share of the gross contributions received through the joint
    fundraising activities from the ASDC Dollars for Democrats, ASDC Partnership Program
    (Association of State Democratic Chairs), and the Democratic National Committee
    State Party Victory Fund are provided on a quarterly basis. The transfer of the
    joint fundraising proceeds received during this reporting period from the ASDC
    Dollars for Democrats, ASDC Partnership, and Democratic National Committee State
    Party Victory Fund programs represents the committee's share of proceeds for contributions
    received during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee.  -  Determination of
    usual and normal charges for Enhanced Online Voter File Access for payments received
    on Schedule A, Line 17 of the Committees report was calculated by the total cost
